import React, { Component } from "react";
import classes from "./table.module.css";
import { connect } from "react-redux";
import Show from "../show/show";
class Table extends Component {
  state = {
    list: [
      {
        title: "Learning java",
        author: "siddhant",
        category: "20",
        length: "java",
      },
      {
        title: "Learning python",
        author: "siddhant",
        category: "20",
        length: "java",
      },
      {
        title: "Learning Ruby",
        author: "siddhant",
        category: "20",
        length: "java",
      },
      {
        title: "Learning react",
        author: "siddhant",
        category: "20",
        length: "java",
      },
      {
        title: "Learning english",
        author: "siddhant",
        category: "20",
        length: "java",
      },
    ],
  };

  render() {
    let value = this.state.list.map((ele) => {
      const d1 = Object.values(ele);
      return <Show key={this.props.count + d1[0]} data={d1} />;
    });
    let value1 = this.props.data.map((ele) => {
      const d1 = Object.values(ele);
      return <Show data={d1} key={this.props.count} count={this.props.count} />;
    });
    return (
      <div>
        {value}
        <div>{value1}</div>
      </div>
    );
  }
}
const mapStateToProps = (state) => {
  const d1 = Object.entries(state);
  const d2 = d1
    .filter((ele) => {
      return ele[0] !== "count";
    })
    .map((ele) => ele[1]);
  return {
    data: d2,
    count: state.count,
  };
};

export default connect(mapStateToProps)(Table);
